measure.description:
The ECOG score is used in the evaluation of cancer patients and can help with prognosis and management of the malignant condition because performance status is highly correlated with survival. A higher ECOG rating score generally equates to a worst outcome. ECOG scores 0 and 1 are defined as:
ECOG Score 0: Asymptomatic (Fully active, able to carry on all pre-disease activities without restriction);
ECOG Score 1: Symptomatic but completely ambulatory (Restricted in physically strenuous activity but ambulatory and able to carry out work of a light or sedentary nature.
